// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract FamilyFund {
    address payable[] private members;
    mapping(address => mapping(uint8 => bool)) paidShares; //each user in each round
    mapping(address => uint8) winners; //map each address to round of win
    address public owner;
    bool public isFundActive; // changed to public
    uint8 public membersCount; // changed to public
    uint8 private round;
    uint private share;
    uint private fundBalance;

    // constructor(uint8 _membersCount, uint _share) {
    //     membersCount = _membersCount;
    //     share = _share;
    //     owner = msg.sender;
    //     round = 1;
    // }

    function createFund(uint8 _membersCount, uint _share) public {
        membersCount = _membersCount;
        share = _share;
        owner = msg.sender;
        round = 1;
        isFundActive = true;
        fundBalance = 0;
    }

    function addMember(address payable _newMember) public OwnerOnly {
        require(isFundActive == true, "Fund is closed!");
        require(findMember(_newMember) == false, "Already added!");
        require(members.length < membersCount, "No empty space!");
        members.push(_newMember);
    }

    function payShare() public payable {
        require(
            paidShares[msg.sender][round - 1] == true,
            "Already paid in this round"
        );
        require(msg.value != share, "Payment value is not valid!");
        fundBalance += msg.value;
        paidShares[msg.sender][round - 1] = true;
    }

    function chooseWinner() public OwnerOnly {
        require(isFundActive == false, "Fund is closed!");
        require(members.length == membersCount, "Some members not added yet!");
        require(isAllPaidInRound() == true, "All members must paid in round!");
        address payable[] memory remains;
        int8 i = -1;
        for (uint8 index = 0; index < members.length; index++)
            if (winners[members[index]] == 0)
                remains[uint(uint8((++i)))] = members[index];

        if (i == 0) {
            // this is the last winner
            weHaveAWinner(remains[0]);
            isFundActive = false;
        } else if (i > 0) {
            //we need more round
            uint8 winnerIndex;
            winnerIndex = chooseRandom(uint8(i));
            weHaveAWinner(members[winnerIndex]);
            round++;
        } else revert("Something bad is happened!");
    }

    function returnFundBalance() public view OwnerOnly returns (uint) {
        return fundBalance;
    }

    modifier OwnerOnly() {
        require(msg.sender == owner, "Sender not authorized");
        _;
    }

    function findMember(address _address) private view returns (bool) {
        for (uint8 i = 0; i < members.length; i++) {
            if (members[i] == _address) {
                return true;
            }
        }
        return false;
    }

    function isAllPaidInRound() private view returns (bool) {
        for (uint8 i = 0; i < members.length; i++)
            if (paidShares[members[i]][round - 1] == false) return false;
        return true;
    }

    function chooseRandom(uint8 _count) private view returns (uint8) {
        return uint8((block.prevrandao + block.timestamp) % _count);
    }

    function weHaveAWinner(address payable _winner) private {
        winners[_winner] = round;
        _winner.transfer(fundBalance);
        fundBalance = 0;
    }
}
